      setCounter(+1)
    }

    const Decrement = () => {
        setCounter(-1)
      }


  return (
    <div>
        <div>{counter}</div>
      <button>Increment +</button>
      <button>Decrement -</button>
      <button>Reset</button>
    </div>
  )
}

export default Counter
